function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Protectedroute> <Task /> </Protectedroute>} />
        <ProtectedRoute path="/login" element={<Navigate to="/" replace />} />
        <ProtectedRoute path="/signup" element={<Navigate to="/" replace />} /> 
      </Routes>
    </div>
  );
}
